import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import "../styles/LoginPage.css";

export default function LoginPage() {
  const navigate = useNavigate();
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [showPwd, setShowPwd] = useState(false);

  function onSubmit(e) {
    e.preventDefault();
    if (email && password) {
      localStorage.setItem("isAuthed", "true");
      navigate("/dataset", { replace: true });
    }
  }

  // Aurora button hotspot follow
  function handleBtnMove(e) {
    const el = e.currentTarget;
    const r = el.getBoundingClientRect();
    const x = (e.clientX - r.left) / r.width;
    const y = (e.clientY - r.top) / r.height;
    el.style.setProperty("--mx", x.toFixed(3));
    el.style.setProperty("--my", y.toFixed(3));
  }
  function resetBtn(e) {
    const el = e.currentTarget;
    el.style.setProperty("--mx", "0.5");
    el.style.setProperty("--my", "0.5");
    el.classList.remove("is-press");
  }

  return (
    <div className="login-page">
      <div className="login-card">
        <header className="login-head">
          <h1 className="login-title">Sign in</h1>
          <p className="login-sub">Access the VRU Radar Micro-Doppler dataset</p>
        </header>

        <form className="login-form" onSubmit={onSubmit} autoComplete="on">
          {/* Email */}
          <label className="field">
            <span className="field-label">Email</span>
            <input
              className="input"
              type="email"
              name="email"
              autoComplete="email"
              placeholder="you@institution.edu"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
          </label>

          {/* Password with eye toggle */}
          <label className="field password-field">
            <span className="field-label">Password</span>
            <div className="password-wrap">
              <input
                className="input"
                type={showPwd ? "text" : "password"}
                name="current-password"
                autoComplete="current-password"
                placeholder="••••••••"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                required
              />
              <button
                type="button"
                className="eye-btn"
                aria-label={showPwd ? "Hide password" : "Show password"}
                aria-pressed={showPwd}
                onClick={() => setShowPwd((v) => !v)}
              >
                {showPwd ? (
                  // eye-off
                  <svg width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
                    <path d="M17.94 17.94A10.94 10.94 0 0 1 12 20C7 20 2.73 16.11 1 12c.53-1.22 1.27-2.35 2.2-3.32M9.88 9.88a3 3 0 1 0 4.24 4.24M6.1 6.1A10.94 10.94 0 0 1 12 4c5 0 9.27 3.89 11 8-.61 1.4-1.5 2.67-2.57 3.74M1 1l22 22" />
                  </svg>
                ) : (
                  // eye
                  <svg width="20" height="20" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
                    <path d="M1 12s4-8 11-8 11 8 11 8-4 8-11 8-11-8-11-8z" />
                    <circle cx="12" cy="12" r="3" />
                  </svg>
                )}
              </button>
            </div>
          </label>

          <div className="actions">
            <button
              type="submit"
              className="btn btn-aurora btn-purple"
              onMouseMove={handleBtnMove}
              onMouseLeave={resetBtn}
              onMouseDown={(e) => e.currentTarget.classList.add("is-press")}
              onMouseUp={(e) => e.currentTarget.classList.remove("is-press")}
            >
              Sign In
            </button>

            <Link
              to="/create-account"
              className="btn btn-aurora btn-outline"
              onMouseMove={handleBtnMove}
              onMouseLeave={resetBtn}
              onMouseDown={(e) => e.currentTarget.classList.add("is-press")}
              onMouseUp={(e) => e.currentTarget.classList.remove("is-press")}
              aria-label="Create a new account"
              title="Create a new account"
            >
              Create Account
            </Link>
          </div>
        </form>

        <footer className="login-footer">
          <Link className="link-muted" to="/reset">
            Forgot password?
          </Link>
        </footer>
      </div>
    </div>
  );
}
